import React from "react";
import Footer from "../../componentes/Footer";
import "../../hojas-de-estilo/Carrito.css";

function Carrito() {
  return (
    <div>
      <div className="container-carrito">
        <BloqueCarrito />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default Carrito;
